import styled from 'styled-components';

const HomeContainer = styled.div`
    .flex;
    .items-center;
    .justify-center;
    .flex-col;
`
const PhotoContainer = styled.div`
    height: 30vh;
    width: 30vh;
    .p-4;
    border-radius: 50%;
    .border;
`;

const Photo = styled.img`
    max-height: 100%
`;

const Home = () => {
    return (
        <HomeContainer>
            <PhotoContainer>
                <Photo src="/logo.png" />
            </PhotoContainer>    
        </HomeContainer>
    );
}

export default Home;
